var favoritedGames = {}

function getFavorites(userId) {
    var requestUrl = 'https://www.roblox.com/users/favorites/list-json?assetTypeId=9&itemsPerPage=100&pageNumber=1&userId=' + userId;


    return new Promise(function(resolve, reject) {
        fetch(requestUrl)
            .then(function(response) {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(function(data) {
                console.log(data)
                favoritedGames = data
            })
            .catch(function(error) {
                console.error('Fetch error:', error);
                reject(error); 
            });
    });
}

function addCommasToNumber(number) {
    let numberString = number.toString();
    let characters = numberString.split('');
    let commaInsertedString = '';
    let commaCount = 0;

    for (let i = characters.length - 1; i >= 0; i--) {
        commaInsertedString = characters[i] + commaInsertedString;
        commaCount++;

        if (commaCount % 3 === 0 && i !== 0) {
            commaInsertedString = ',' + commaInsertedString;
        }
    }

    return commaInsertedString;
}

function getUserId(parentClass) {
    function extractNumbersFromLink(link) {
        var numbers = link.match(/\d+/g);
        
        if (numbers) {
            return numbers.map(Number); 
        } else {
            return [];
        }
    }

    var button = document.querySelector('.' + parentClass);
    
    if(button) {
        var parentElement = button.parentElement;
        var childElement = parentElement.querySelector('a[href]');
        
        if(childElement) {
            var href = childElement.getAttribute('href');
            return extractNumbersFromLink(href);
        }
    }
    
    return 0;
}

