// game info
setTimeout(function() {
    var elements = document.querySelectorAll('.game-card-link');

    elements.forEach(function(element, index) {
        setTimeout(function() {
            var hrefUrl = element.getAttribute('href');
            getCurrentPlaying(hrefUrl)
                .then(function(totalValue) {
                    var gameImageContainer = element.querySelector('.thumbnail-2d-container');
                    if (gameImageContainer) {

                        var activePlayersContainer = document.createElement('div');
                        activePlayersContainer.className = 'active-players-container';
    
                        var activePlayersImage = document.createElement('img');
                        activePlayersImage.className = 'active-players-image';
                        activePlayersImage.src = profileImage;
    
                        var activePlayersParagraph = document.createElement('p');
                        activePlayersParagraph.className = 'active-players-paragraph';
                        activePlayersParagraph.textContent = addCommasToNumber(totalValue);
    
                        activePlayersContainer.appendChild(activePlayersImage);
                        activePlayersContainer.appendChild(activePlayersParagraph);
                        gameImageContainer.appendChild(activePlayersContainer);

                        var span = document.createElement('span');
                        span.textContent = activePlayersParagraph.textContent;
                        span.style.visibility = 'hidden';
                        document.body.appendChild(span);
                        var textWidth = span.offsetWidth;
                        document.body.removeChild(span);
                        
                        var containerPadding = 15; 
                        var containerWidth = textWidth + 2 * containerPadding; 
                        activePlayersContainer.style.width = containerWidth + 'px';
                    }
                });
        }, index * 500);
    });
}, 1000);

