var userIdPattern = /^\/users\/\d+\/profile$/;
var groupPattern = /^\/groups\/\d+\/.*$/;
if (userIdPattern.test(currentPage)) {
    var img = document.querySelector('.robloxify-sidebar-slider');
    img.style.top =  '48.13%';
    img.style.left = '0%';
} else if (groupPattern.test(currentPage)) {
    var img = document.querySelector('.robloxify-sidebar-slider');
    img.style.top =  '60.1%';
    img.style.left = '0%';
} else {
    var position = positions[currentPage];
    if (position) {
        var img = document.querySelector('.robloxify-sidebar-slider');
        img.style.top = position.top + '%';
        img.style.left = position.left + '%';
    }
}

